import React, {useState} from 'react'
import {register} from './Auth'
  
const Register = () => {
    const [form,setForm] = useState({
        email:'',
        password:'',
        nombre: '',
        apellido: '',
        usuario:''
    })
    const handleSubmit = async(e)=>{
        e.preventDefault();
        await register(form);
  
    }
    return (
        <div>
            <h1>Register</h1>
            <form onSubmit={handleSubmit} >
            <label for="email">Email</label>
            <input type="text" style={InputFields} placeholder="email" id="mail"  onChange={(e) =>  setForm({...form, email: e.target.value})} />
            <br/>
            <label for="password">Password</label>
            <input type="password"  placeholder="Password" style={InputFields}   onChange={(e) =>  setForm({...form, password: e.target.value})}/>
            <br/>
            <button type="submit" style={ButtonStyle}> Submit</button>
            </form>
        </div>
  
    )
}
  
export default Register
